script: |
  super -f text -I q234.spq | sort > q234.out

inputs:
  - name: q234.spq
    data: |
      SELECT DISTINCT - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * col0 * + col1 BETWEEN ( + - col2 ) AND col1;
  - name: tab1

outputs:
  - name: q234.out
    data: |
      -51
      -85
      -91
